import axios from 'axios';
import React, { useEffect, useState } from 'react';
import '../styles/Catalog.css'

const ShopCategory = () => {
  
  const [data, setData] = useState([])
  useEffect(() => {
    axios.get('http://localhost:3001/products')
    .then(res => setData(res.data))
    .catch(err => console.log(err))
  }, [])
  return (
    <div className="items">
      <h2>О нас:</h2>
            <p>В <strong>Наценочке</strong> мы верим, что покупка должна быть легкой и приятной. Наш ассортимент включает в себя всё необходимое для повседневной жизни: от свежих продуктов питания до товаров для дома и уюта. Мы гордимся нашим вниманием к качеству и стремимся предоставлять нашим клиентам только лучшие товары.</p>
            
            <h2>Почему выбирают нас:</h2>
            <ul>
                <li><strong>Широкий ассортимент:</strong> В нашем магазине вы найдёте всё, что нужно для полноценной и комфортной жизни.</li>
                <li><strong>Высокое качество:</strong> Мы тщательно выбираем поставщиков и следим за качеством каждого продукта.</li>
                <li><strong>Доступные цены:</strong> Мы предлагаем конкурентные цены, чтобы каждый мог позволить себе лучшие товары.</li>
                <li><strong>Удобный сервис:</strong> Наша команда всегда готова помочь вам с выбором и ответить на все вопросы.</li>
            </ul>
            
            <h2>Наши услуги:</h2>
            <ul>
                <li><strong>Онлайн-заказ и доставка:</strong> Оформите заказ онлайн и получите его прямо к вашей двери.</li>
                <li><strong>Программа лояльности:</strong> Накопительные бонусы и специальные предложения для постоянных клиентов.</li>
                <li><strong>Акции и скидки:</strong> Регулярные распродажи и специальные предложения.</li>
            </ul>
            
      {data.map((d,i) => {
        return  <div>
        <div className="item" key={i}>
          <img src={d.image} alt={d.image} className="item-image" />
          <p className="item-name">{d.name}</p>
          <pre className="item-price">{d.price}</pre>
        </div>
        </div>
      })}
    </div>
  );
};

export default ShopCategory;
